/*!40000 ALTER TABLE `item` DISABLE KEYS */;
INSERT INTO `item` VALUES (1,'Sai',NULL,'The sai (釵) is a traditional Okinawan weapon. The basic form of the weapon is that of a pointed, dagger-shaped truncheon, with two curved prongs called yoku projecting from the handle.','sai.gif',1,'1H',NULL,'\0',NULL,20,''),(2,'Bokuto',NULL,'A bokuto (木刀), is a Japanese wooden sword used for training, usually the size and shape of a katana, but sometimes shaped like other swords, such as the wakizashi and tantou. Bokuto should not be confused with shinai, a sword made of bamboo that is used for practice in kendo.','bokuto.gif',2,'2H',NULL,'\0',NULL,30,''),(3,'Tattered kimono',NULL,'This kimono has seen better days, and it smells like yesterday\'s sushi. Nevertheless, it has a rustic charm&mdash;and what are you going to do, walk around naked?','',1,'Torso',NULL,'\0',NULL,20,'\0'),(4,'Bowl',NULL,'There are still some bits of rice stuck in the bottom. Maybe after you\'re done using it for armor, you could eat out of it (provided you are still alive).','',1,'Head',NULL,'\0',NULL,20,''),(5,'Bandage','bandage','Using a bandage will heal the target for 5HP.','',1,NULL,1,'',NULL,NULL,'\0'),(6,'Antidote','antidote','Using antidote will cure the target of any Poison effects.','',1,NULL,1,'',NULL,NULL,'\0'),(7,'Ceremonial robes','ceremonialrobes','These flowing, ceremonial robes glow with a faint, white light. They are warm to the touch, and an immediate sense of calm washes over any individual wearing this fashionable item.','',1,'Torso',NULL,'\0',NULL,14,'\0'),(8,'Family chokuto','familychokuto','This chokuto (直刀, \"straight sword\") has a deep and bloody family history. If it is left unsheathed, the cries of vengeance from a thousand years of ancestors will devour you.','',3,'2H',NULL,'\0',NULL,14,'\0'),(10,'Straw kote',NULL,'These woven straw sparring gloves offer minor protection from damage.','',1,'Arms',NULL,'\0',NULL,20,'\0'),(11,'Straw sandals',NULL,'These simple farmer\'s footwear are barely enough beneath your feet to protect them from the earth; but they\'re better than nothing.','straw-sandals.gif',1,'Legs',NULL,'\0',NULL,20,'\0'),(12,'Hankyuu',NULL,'The hankyuu, or short bow, is an effective ranged weapon capable of producing good results when hunting game&mdash;or enemy soldiers.','',3,'2H',NULL,'\0',NULL,30,''),(13,'Wooden arrow',NULL,'Though they don\'t pack the most powerful punch, these artfully-crafted wooden arrows will get the job done.','',1,NULL,NULL,'',NULL,NULL,'\0'),(14,'Steel arrow',NULL,'These more technologically-advanced, steel-tipped arrows inflict additional damage when they strike home.','',1,NULL,NULL,'',NULL,NULL,'\0'),(15,'Kurumaken',NULL,'Shuriken (手裏剣), or \"sword hidden in the hand,\" are traditional Japanese concealed throwing weapons. The kurumaken (車剣), or \"wheel\" shuriken, are generally referred to as \"throwing stars\" in western culture.','kurumaken.gif',1,NULL,NULL,'',NULL,NULL,'\0'),(16,'Lead ore',NULL,'This is a common metal used in crafting tools, weapons, and rudimentary armor.','',3,NULL,NULL,'',NULL,NULL,'\0'),(17,'Lumber',NULL,'This is a basic crafting material used for weapons, tools, construction, and more.','',3,NULL,NULL,'',NULL,NULL,'\0'),(18,'Lead bar',NULL,'This is a crafting material to be used in the construction of tools, armor, etc.','',3,NULL,NULL,'',NULL,NULL,'\0'),(19,'Mining pick',NULL,'This mining pick is used in the procurement of raw precious metals from the mountains. It can also be used as a makeshift weapon.','',3,'2H',NULL,'\0',NULL,20,'\0'),(20,'Wood axe',NULL,'This is a tool used for gathering lumber from forests. It can also be used as a makeshift weapon.','',3,'2H',NULL,'\0',NULL,20,'\0'),(21,'Wood plank',NULL,'These planks are used by carpenters to craft useful items.','',2,NULL,NULL,'',NULL,NULL,'\0'),(22,'Raw fish','food_rawfish','This raw fish is somewhat edible&hellip; but at what peril?','',1,NULL,0,'',72,NULL,'\0'),(23,'Blueprint: Shack','bp_shack','With this blueprint, you can be the proud owner of your very own Shack. It\'s the first step to making your way in the world of real estate.\r\n<p style=\"clear:both\">Items required:<ul><li>15x Wood plank</li><li>10x Lead bar</li></ul></p>','shack.gif',1,NULL,0,'',NULL,NULL,'\0'),(24,'Shack in a Box&trade;','instantshack','When used on an empty Grass tile, this magical suitcase will fold out into your very own Shack&mdash;no assembly required!','shack.gif',10,NULL,0,'\0',NULL,NULL,'\0'),(25,'Uncooked Rice',NULL,'This bag of uncooked rice is inedible in its current state.','bagofrice.gif',2,NULL,NULL,'',NULL,NULL,'\0'),(26,'Steamed rice','food_steamedrice','This dish is nothing special by itself&mdash;but it <i>is</i> food.','cookedrice.gif',1,NULL,0,'\0',72,NULL,'\0'),(27,'Sushi','food_sushi','This plain, raw fish has been prepared properly.','',1,NULL,0,'\0',NULL,NULL,'\0'),(28,'Copper armor','copperarmor','','',3,'Torso',NULL,'\0',NULL,12,''),(29,'Copper ore','ore_copper','','',1,NULL,NULL,'',NULL,NULL,'\0'),(30,'Copper bar','copperbar','','',1,NULL,NULL,'',NULL,NULL,'\0'),(31,'Tessen (Iron fan)','tessen','This fan is composed of iron spokes and blades. It makes for a handy truncheon, and aids in defense against ranged weapons.','',2,'1H',NULL,'\0',NULL,20,'');
/*!40000 ALTER TABLE `item` ENABLE KEYS */;
UNLOCK TABLES;

